import React from "react";
import styled from "styled-components";

const Review = (props) => {

    return (
        <div>
            <Container>
                <div>
                    <Day>화요일</Day>
                    <Title>평점 남기기</Title>
                </div>
                <CircleContainer>
                    <GrayCircle />
                    <GrayCircle />
                    <GrayCircle />
                    <GrayCircle />
                    <GrayCircle />
                </CircleContainer>
                <Button>평점 남기기</Button>
            </Container>
        </div>
    );
}
const Day = styled.div`

`;

const Title = styled.div`
  text-align: center;
  font-size: 20px;
  font-weight: bold;
`;

const Container = styled.div`
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 15px;
`;
const CircleContainer = styled.div`
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 15px;
`;

const YellowCircle = styled.div`
    width: 30px;
    height: 30px;
    border-radius: 30px;
    margin: 5px;
    background-color: yellow;
`;

const GrayCircle = styled.div`
    width: 30px;
    height: 30px;
    border-radius: 30px;
    margin: 5px;
    background-color: #eee;
`;

const Button = styled.button`
    width: 100%;
    background-color: purple;
    border: none;
    border-radius: 5px;
    padding: 1rem;
    color: rgb(255, 255, 255);
`;

export default Review
